import React, { useState } from 'react'
import { Card } from 'semantic-ui-react'

const src = './media/profile_pictures/default.jpg'

const DefaultImage = () => {
    return (
        <div>
            <Card.Group itemsPerRow={1}>
                <Card raised image={require('./media/profile_pictures/default.jpg')} />
            </Card.Group>
        </div>
    )
}

export default DefaultImage
